import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('RobotoCondensed-Italic-VariableFont_wght-italic.ttf', font);
this.addFont('RobotoCondensed-Italic-VariableFont_wght-italic.ttf', 'RobotoCondensed-Italic-VariableFont_wght', 'italic');
};
jsPDF.API.events.push(['addFonts', callAddFont])
